import Header from "./components/Header.js";
import "./App.css";

function App() {
  return (
    <div className="App">
      <Header />
      <main>
        <section id="home">
          <h2>Home</h2>
          <p>Welcome to my portfolio!</p>
        </section>
        <section id="projects">
          <h2>Projects</h2>
          <p>Check out my awesome projects!</p>
        </section>
        <section id="contact">
          <h2>Contact</h2>
          <p>Let's get in touch!</p>
        </section>
      </main>
    </div>
  );
}

export default App;
